ecked & submitted automatically?'=>'应多久检查一次付款请求并自动提交？','How to assign affiliate users to coupons'=>'如何将会员用户分配给优惠券','How to customize the affiliate registration form?'=>'如何自定义会员注册表单？','How to exclude specific products from commission?'=>'如何从佣金中排除特定产品？','How to export affiliate reports in WooCommerce?'=>'如何在WooCommerce中导出会员报告？','How to fix “ERROR: Failed to load ajax request.”'=>'如何修复“错误：无法加载 ajax 请求”。','How To Get Started'=>'如何开始','How to set up tiered affiliate commissions?'=>'如何设置分层联盟佣金？','How to track affiliate sales and commissions in WooCommerce?'=>'如何在WooCommerce中跟踪会员销售和佣金？','How to track coupon usage in WooCommerce?'=>'如何在WooCommerce中跟踪优惠券使用情况？','How to use the Coupon Usage Tracker plugin?'=>'如何使用优惠券使用跟踪器插件？','How will you promote us?'=>'你将如何宣传我们？','However, if preferred, you can use a 3rd party wallet plugin for the store credit payouts. This does however require more setup work, and an additional integration plugin.'=>'但是，如果愿意，您可以使用第三方钱包插件进行商店信用额度支付。但是，这确实需要更多的设置工作和额外的集成插件。','https://couponaffiliates.com'=>'https://couponaffiliates.com','https://couponaffiliates.com/'=>'https://couponaffiliates.com/#about','Icon Colour'=>'图标颜色','ID'=>'ID','If an order is refunded then the commission will be removed from the users account.'=>'如果订单已退还，则佣金将从用户帐户中删除。','If disabled, by default the referral will only be tracked if the customer applys the affiliates coupon when placing their order.'=>'如果禁用，默认情况下，仅当客户在下订单时应用会员优惠券时，才会跟踪推荐。','If disabled, it will instead store an extra random ID as a cookie for new referral clicks ("wcusage_referral_id") which will then work in the same way.'=>'如果禁用，它将存储一个额外的随机ID作为cookie，用于新的推荐点击（"wcusage_referral_id"），然后以相同的方式工作。','If disabled, only the first click from the visitor will be tracked (until the cookie expires).'=>'如果禁用，将只跟踪访问者的第一次点击（直到 Cookie 过期）。','If disabled, only the parent (first) order for the subscription will earn commission.'=>'如果禁用，只有父（第一）订单的订阅将赚取佣金。','If enabled, all new referral URL clicks from the same user will be tracked (and increases total clicks + visit logged in click history). Only the latest click will be converted if they make a purchase.'=>'如果启用，将跟踪来自同一用户的所有新转介 URL 单击（并增加总点击次数 + 访问记录在单击历史记录中）。只有最新的点击将转换，如果他们作出购买。','If enabled, an option will be displayed in the affiliate dashboard settings tab, allowing affiliates to turn off the email reports.'=>'如果启用，则会在联盟仪表板设置选项卡中显示一个选项，允许关联公司关闭电子邮件报告。','If enabled, if someone visits the site via the referral URL and places an order without using the coupon code, it will still be tracked and award the affiliate.'=>'如果启用，如果有人通过推荐 URL 访问该网站并在不使用优惠券代码的情况下下订单，它仍将被跟踪并奖励会员。','If enabled, order tax will be added to the fixed commission calculations.'=>'如果启用，订单税将添加到固定佣金计算中。','If enabled, order tax will be added to the order subtotal/total/discount for orders in the statistics, and when calculating percentage (%) commission calculations.'=>'如果启用，订单税将添加到统计信息中订单的订单小计/总计/折扣中，并在计算百分比（%）佣金计算时添加。','If enabled, the "MLA Dashboard" will only be accessible to specific affiliate users that you give access to (edit the user and enable "MLA Dashboard Access").'=>'如果启用，“MLA 仪表板”将仅供您授予访问权限的特定关联用户访问（编辑用户并启用“MLA 仪表板访问权限”）。','If enabled, the affiliate reports will be turned on by default for all affiliate users (if they have not yet updated the setting). They can toggle this off in the settings tab of their dashboard. If disabled, then the reports will be turned off by default, and the affiliate user will need to toggle it on to receive the reports.'=>'如果启用，所有联盟用户（如果他们尚未更新设置）默认情况下将打开联盟报告。他们可以在仪表板的设置选项卡中切换此选项卡。如果禁用，则默认情况下将关闭报告，联盟用户需要切换以接收报告。','If enabled, the first time a new dynamic creative is generated for an affiliate, this will be cached for 24 hours, unless the creative is updated. This results better performance and less resource usage.'=>'启用后，首次为联属营销机构生成新的动态广告素材时，系统会缓存 24 小时，除非该广告素材已更新。这样可以提高性能并减少资源使用。','If enabled, the plugin will attempt to apply the code on the first page they visit. If disabled, it will only apply the code once they visit the cart/checkout pages.'=>'如果启用，插件将尝试在第一次访问页面时应用代码。如果禁用，它将仅在购物车/结帐页面上应用代码。','If enabled, the tracking cookies will be deleted from the customers browser, once the order is completed.'=>'如果启用，一旦订单完成，跟踪 cookie 将从客户浏览器中删除。','If enabled, then the registration form shortcode will be disabled/hidden for any affiliate user that is already assigned to an affiliate coupon.'=>'如果启用，则对于已分配到联盟优惠券的任何联盟用户，注册表单将被禁用/隐藏。','If enabled, when uninstalling (deleting) the plugin, most plugin options and custom tables/data created by this plugin will be deleted. Some data will still remain such as custom order & coupon meta data (if any).'=>'如果启用，当拆装（删除）插件时，将删除此插件创建的大部分插件选项和自定义表/数据。某些数据仍将保留，如自定义订单和优惠券元数据（如果有）。','If enabled, whenever a new user is created (in any way), an affiliate registration will also be submitted for them automatically.'=>'如果启用，每当创建新用户（以任何方式）时，也将自动为他们提交联盟注册。','If for some reason the user deletes/removes the coupon manually from their cart, the cookie will also be removed.'=>'如果出于某种原因，用户从购物车里手动删除优惠券，则 Cookie 也将被删除。','If needed, you can <a href="%s" target="_blank">make the link alone track referrals</a> without requiring the affiliates coupon to be applied, ensuring affiliates receive credit for every sale referred.'=>'如果需要，您可以 <a href="%s">单独使用链接跟踪推荐</a> ，而无需应用会员优惠券，从而确保会员获得推荐的每笔销售的信用。','If preferred, you can enable "New Customers Only" for individual coupons in the "Usage limits" coupon settings tab.'=>'如果愿意，您可以在"使用限制"优惠券设置选项卡中为单个优惠券启用"仅限新客户"。','If selected, this payout method will only be available for this user role.'=>'如果选择此选项，则此收款方式仅适用于此用户角色。','If set to "0" then commission will be added to the affiliates account instantly when an order is completed.'=>'如果设置为"0"，则当订单完成时，佣金将立即添加到关联帐户。','If the affiliate user is assigned to multiple user roles, it will apply the commission rates for the first role it detects with any custom values set.'=>'如果联盟用户被分配到多个用户角色，它将使用设置的任何自定义值对其检测到的第一个角色应用佣金率。','If the affiliates coupon'=>'如果会员优惠券','If the checkbox is selected below, this user has been granted this award/bonus.'=>'如果选中下面的复选框，则此用户已获得此奖励/奖金。','If the referral URL is clicked, the coupon code will automatically be applied to the users checkout. The coupon must be used for commission to be tracked.'=>'如果使用转介 URL，优惠券代码将自动应用于用户结账。优惠券必须用于跟踪佣金。','If the user does not exist, a new one will be created.'=>'如果该用户不存在，则将创建一个新用户。','If the user is an admin, then the ID will also be clickable to open the order page in the backend.'=>'如果用户是管理员，则 ID 也将可单击以打开后端的订单页面。','If the user is not already registered as an affiliate and has no active coupons, this will show the registration from on the affiliate dashboard page.'=>'如果用户尚未注册为 affilaite，并且没有活动优惠券，这将显示从附属仪表板页面上的注册。','If there are no landing pages assigned to the coupon, then this will be hidden.'=>'如果没有分配给优惠券的着陆页，则将隐藏此页面。','If this is your first time loading this dashboard, and it\'s a large coupon, it may take a little while to load.'=>'如果这是您第一次加载此仪表板，并且它是一个很大的优惠券，则可能需要一些时间来加载。','If you are experiencing any performance issues or other bugs with the plugin, please try enabling/disabling relevant settings below.'=>'如果您遇到任何性能问题或其他错误与插件，请尝试启用/禁用下面的相关设置。','If you are getting the "Failed to load ajax request" error on the affiliate dashboard'=>'如果您在联盟仪表板上收到“无法加载ajax请求”错误','If you dont want the message to always show, toggle this setting on, and it will instead only show on the cart/checkout pages.'=>'如果您不希望邮件始终显示，请切换此设置，而它只会显示在购物车/结账页面上。','If you experience very high volumes of orders for each coupon, this should help greately with affiliate dashboard speed/performance.'=>'如果您体验到每张优惠券的订单量非常大，这应该对附属仪表板的速度/性能有很大的帮助。','If you have any suggestions for new types of bonus requirements or rewards, <a href="%s" target="_blank">please let us know</a>.'=>'如果您对新类型的奖金要求或奖励有任何建议， <a href="%s" target="_blank">请告诉我们</a>。','If you need help getting started, or have any questions at all, you can <a href="%s">create a support ticket</a> any time, and we will be happy to help.'=>'如果您在入门时需要帮助，或者有任何疑问，您可以随时 <a href="%s">创建支持票证</a> ，我们将很乐意为您提供帮助。','If you need to use a different base currency (%s), you will need to upgrade to the "Basic" API plan.'=>'如果您需要使用其他基础货币 （%s），则需要升级到“基本”API 计划。','If you set custom "coupon" commission for that affiliate, or "per product" commission, they WILL take priority over the "user role" commission.'=>'如果您为该联盟会员设置自定义"优惠券"佣金或"每件产品"佣金，他们将优先获得"用户角色"佣金。','If you want to show the logged in users current store credit balance somewhere, use the shortcode'=>'如果要在某个位置显示已登录用户当前的商店信用余额，请使用短代码','If you wish to manually submit payout request for your affiliates, you can do so from this page. After submitting a payout request, you will be redirected to the "Payouts" page to view, manage and finalize the payout.'=>'如果您希望手动为您的关联公司提交付款请求，可以从此页面进行。提交提现请求后，您将被重定向到“提现”页面，以查看、管理和完成提现。','Image:'=>'图像：','Import / Export Custom Tables'=>'导入/导出自定义表','Import and Export the custom database tables created by this plugin.'=>'导入和导出此插件创建的自定义数据库表。','Import/Export Custom Tables'=>'导入/导出自定义表','Important Information'=>'重要信息','Important: If your short URLs show a 404 page after changing this, you may need to go to the "Settings > Permalinks" page and click "Save Changes" to refresh your permalinks.'=>'重要提示：如果您的短网址在更改后显示 404 页面，您可能需要转到"永久链接>设置"页面，然后单击"保存更改"以刷新永久链接。','Important: There are some cases where direct link tracking may not be detected properly.'=>'重要提示：在某些情况下，可能无法正确检测到直接链接跟踪。','Important: This is only recommended if you experience high levels of affiliate fraud, and/or want a strict way to help stop unauthorized referrals.'=>'重要提示：仅当您遇到高水平的联盟欺诈和/或希望以严格的方式帮助阻止未经授权的推荐时，才建议这样做。','Important: This needs to be different to your normal affiliate referral URL prefix.'=>'重要提示：这需要与您的普通联盟推荐网址前缀不同。','in'=>'在','In most cases PayPal Payouts fees are 2%.'=>'在大多数情况下，PayPal支付费用为2%。','In the affiliate report, stats will be shown/calculated based on the previous date range. So monthly reports will show stats from the previous month.'=>'在关联报告中，将根据以前的日期范围显示/计算统计数据。因此，月度报告将显示上月的统计数据。','In this preview, example values are