n the "settings" tab on their dashboard).'=>'联盟用户已输入其付款详细信息（在其仪表板上的"设置"选项卡中）。','The affiliate user has not yet been set for this coupon.'=>'联盟用户尚未设置此优惠券。','The affiliate user has not yet set their payout details on the affiliate dashboard.'=>'联盟用户尚未在联盟仪表板上设置其付款详细信息。','The below section includes a list of most of the modules and features included in the Pro plan. However other smaller features and customisations can be found throughout the settings page.'=>'下面的部分包括 Pro 计划中包含的大部分模块和功能的列表。但是，在整个设置页面中可以找到其他较小的功能和自定义。','The below table will show all affiliate coupons where the "unpaid commission" amount is more than'=>'下表将显示“未付佣金”金额超过','The commission for multi-level tiers is calculated based on a percentage of the <strong>amount earned by the main affiliate</strong>. This is NOT deducted from the main affiliates earnings.'=>'多层次等级的佣金是根据<strong>主要联盟会员赚取的金额</strong>的百分比计算的。这不会从主要联盟会员的收入中扣除。','The coupon code you entered does not exist.'=>'您输入的优惠券代码不存在。','The coupon has an affiliate user assigned to it.'=>'优惠券有一个附属用户分配给它。','The creative will only be visible to affiliates with this user role.'=>'该广告素材仅对具有此用户身份的联属网络受众可见。','The default "Page URL" when affiliates generate referral links in the dashboard. Note: This needs to be a valid link/page on this website only.'=>'会员在仪表板中生成引荐链接时的默认“页面 URL”。注意：这只需要是本网站上的有效链接/页面。','The email address of the affiliate.'=>'会员的电子邮件地址。','The first name of the affiliate.'=>'关联公司的名字。','The following integration addons are available to download and install right now:'=>'以下集成插件现在可供下载和安装：','The free version gives access to admin reports for the past 4 weeks. Reports allow you to see the overall statistics for all affiliates/coupons, and each individual affiliate/coupon, on a single page'=>'免费版本可以访问过去4周的管理员报告。报告允许您在单个页面上查看所有联盟/优惠券以及每个单独的联盟/优惠券的整体统计信息','The gift coupon code that was generated.'=>'生成的礼品券代码。','The IP address will be stored in the "clicks" database table. The IP address is only used to check if a click has already been tracked for that visitor.'=>'IP 地址将存储在"点击次数"数据库表中。IP地址仅用于检查是否已跟踪该访问者的点击。','The last name of the affiliate.'=>'关联公司的姓氏。','The maximum amount of extra tiers in your MLA system (not including the main affiliate).'=>'MLA 系统中额外层数的最大数量（不包括主要联盟）。','The maximum date range is 12 months. Your filters have been updated.'=>'最大日期范围为 12 个月。您的过滤器已更新。','The maximum number of orders to show when filtered by date. Too many could make it take significantly longer to load.'=>'按日期筛选时要显示的最大订单数。太多可能会使加载时间大大延长。','The name of your Store Credit wallet, show in the payout method selection etc.'=>'您的商店信用钱包的名称，显示在支付方式选择等中。','The next scheduled payout requests will be on'=>'下一个预定的提现请求将开启','The number of days after an order is created, that the commission earned is added to the users account as "unpaid commission. Useful if you want to prevent commission being paid out early for orders that may be refunded etc.'=>'创建订单后的天数，赚取的佣金将作为“未支付佣金”添加到用户帐户中。如果您想防止为可能退款的订单提前支付佣金等，这很有用。','The order status required for "unpaid commission" to be granted. Default "completed" for most sites. This should be the final status for your orders, once it has been paid and delivered.'=>'授予"未付佣金"所需的订单状态。大多数站点的默认"已完成"。这应该是您的订单的最终状态，一旦它已经支付和交付。','The passwords do not match. Please try again.'=>'密码不匹配。请重试。','The stats/content isn’t loading on my dashboard. How can I fix this?'=>'统计信息/内容未加载到我的仪表板上。我该如何解决这个问题？','The table shows up to 20 products per page by default, with pagination, and a search field.'=>'默认情况下，该表每页最多显示 20 个产品，带有分页和搜索字段。','The tax rate that will be added to the payment statements.'=>'将添加到付款报表中的税率。','The total commission you have earned from this specific sub-affiliate referrals.'=>'您从此特定子会员推荐中获得的总佣金。','The unpaid commission amount is below the payout threshold.'=>'未支付的佣金金额低于支付门槛。','The username of the affiliate.'=>'会员的用户名。','The username will be used as the coupon code by default, unless you have the "Dynamic Code Generator" enabled.'=>'默认情况下，用户名将用作优惠券代码，除非您启用了“动态代码生成器”。','Then, only users that are assigned to a coupon will be able to see their dashboard (for that coupon) on this page.'=>'然后，只有分配给优惠券的用户才能在此页面上查看其仪表板（用于该优惠券）。','There are several other ways payout requests can be submitted, for the affiliates available "unpaid commission".'=>'对于会员来说，还有其他几种方式可以提交支付请求，以获得“未支付的佣金”。','There have been no clicks for this campaign yet.'=>'此活动尚未点击。','There was an error connecting to Stripe account. Please contact an administrator.'=>'连接到条纹帐户时出现了错误。请联系管理员。','These are line graphs that show the commission earnings for every day in the past 90 days, 30 days or 7 days.'=>'这些是折线图，显示了过去 90 天、30 天或 7 天内每天的佣金收入。','These details will be shown on your PDF statements for payouts.'=>'这些详细信息将显示在您的 PDF 付款报表上。','These options will improve loading speed of your affiliate dashboard for large coupons with lots of orders (since it wont need to calculate every time).'=>'这些选项将提高您的附属仪表板的加载速度，用于大量订单的大型优惠券（因为它不需要每次计算）。','These settings allow you to restrict the bonus to only be available for specific users.'=>'这些设置允许您将奖金限制为仅对特定用户可用。','These values be overridden on a per coupon and/or per product basis.'=>'这些值按每份优惠券和/或每个产品计算。','These visitors will not be able to use any affiliate coupons on their purchases, and can not apply to become an affiliate.'=>'这些访问者将无法在购买时使用任何联盟优惠券，并且不能申请成为联盟会员。','They would need to click the referral link again for coupons to be automatically applied again, or future orders to be awarded to the affiliate.'=>'他们需要再次单击推荐链接才能再次自动应用优惠券，或者将来将订单授予会员。','This affiliate is a part of your MLA network. You are viewing their statistics and commission earnings.'=>'此联盟会员是您的 MLA 网络的一部分。您正在查看他们的统计数据和佣金收入。','This allows you to set the maximum commission amount that is calculated and can be earned per order referred by affiliates.'=>'这允许您设置计算的最大佣金金额，并且可以为每个会员推荐的订单赚取。','This bonus is not applied on the dashboard or when they request payouts. It will simply apply the bonus % as additional credit, when the payout is marked as paid.'=>'此奖金不会应用于仪表板上或当他们请求付款时。当付款被标记为已付款时，它只会将奖金百分比用作额外信用额度。','This can not be edited for a lifetime affiliate referral.'=>'对于终身会员推荐，这无法编辑。','This can not be edited when the order is completed.'=>'订单完成后无法编辑。','This email already exists. Please try again, or login first.'=>'此电子邮件已存在。请重试，或先登录。','This email has already been invited.'=>'此电子邮件已收到邀请。','This excludes the plugin settings which are available to those with the "manage_options" permission.'=>'这不包括具有"manage_options"权限的插件设置。','This feature allows you to collect the conversion rates automatically from an Exchange Rates API.'=>'此功能允许您从“汇率API”自动收集转换率。','This is how many days after someone clicks on a referral link, that the cookie will be stored to automatically apply the coupon.'=>'这是多少天后，有人点击转介链接，饼干将被存储，以自动应用优惠券。','This is limited to PDF files only, and maximum size of 200KB. These invoices will be uploaded to a "coupon-affiliate-invoices" folder in your uploads directory.'=>'这仅限 PDF 文件，最大尺寸为 200KB。这些发票将上传到上传目录中的"优惠券联盟发票"文件夹。','This is our default store credit system, built directly into this plugin. (A more simple solution with no additional setup needed.)'=>'这是我们的默认商店信用系统，直接内置于此插件中。（更简单的解决方案，无需额外设置。','This is shown at the bottom of the PDF statements, just before the Footer Text. Recommended size is no larger than 340 x 70'=>'这显示在 PDF 语句的底部，就在脚文本之前。推荐尺寸不超过 340 x 70','This is shown at the very top of the PDF report (attached to the email). Recommended size is 340 x 70.'=>'这显示在 PDF 报告的顶部（附在电子邮件上）。推荐尺寸为 340 x 70。','This is shown at the very top of the PDF statements. Recommended size is 340 x 70'=>'这显示在 PDF 声明的顶部。推荐尺寸为 340 x 70','This is shown below the message above, next to a checkbox, allowing them to apply some or all of their credit to the cart.'=>'这显示在上面的消息下方，在复选框旁边，允许他们将部分或全部信用额度应用于购物车。','This is the amount of bonus commission (flat amount) they will be given from this reward.'=>'这是他们将从此奖励中获得的奖金佣金（固定金额）。','This is the amount of days that will be calculated at a time. If you experience issues with the ajax loading, try lowering this number (will be slower but more reliable).'=>'这是一次将计算的天数。如果您在加载 ajax 时遇到问题，请尝试降低此数字（数字越小越慢）。','This is the amount of store credit they will be given from this reward. Funds are added directly to their store credit wallet.'=>'这是他们将从此奖励中获得的商店积分金额。资金直接添加到他们的商店信用钱包中。','This is the amount their earned commission from orders will be increased by. For example, 5% would increase $100 commission to $105. This will override any existing reward bonus set.'=>'这是他们从订单中获得的佣金将增加的金额。例如，5% 会将 100 美元的佣金增加到 105 美元。这将覆盖任何现有的奖励奖金集。','This is the base currency for your store, in which totals/commission will be converted to. You can change this in the WooCommerce settings.'=>'这是您商店的基本货币，总金额/佣金将转换为总金额/ 佣金。您可以在伍商业设置中更改此设置。','This is the default referral link your affiliates can share. If clicked it will track statistics, and auto-apply the coupon to the customers cart.'=>'这是您的会员可以共享的默认推荐链接。如果单击，它将跟踪统计信息，并自动将优惠券应用于客户购物车。','This is the description that will be shown under the progress bar. By default, it shows a summary of the requirement for the reward.'=>'这是将显示在进度条下的描述。默认情况下，它显示奖励要求的摘要。','This is the email address that will recieve admin notifications such as new affiliate registrations, and payout notifications.'=>'这是电子邮件地址，将接收管理员通知，如新的联盟应用程序和付款通知。','This is the frequency that the reward can be triggered. For example, if you select "Once Per Month", the reward can only be earned once within a month. In the next month, they can earn the reward again on their next order if they meet the requirements. This refers to the current week/month/year, for example %s or %s.'=>'这是可以触发奖励的频率。例如，如果您选择“每月一次”，则奖励只能在一个月内获得一次。在下个月，如果他们符合要求，他们可以在下一个订单中再次获得奖励。这是指当前周/月/年，例如 %s 或 %s。','This is the limit on how many renewal orders will be rewarded to the affiliate after the initial signup. This does not include the initial order. Set to 0 for unlimited renewals.'=>'这是在初始注册后向关联公司奖励多少续订订单的限制。这不包括初始订单。设置为 0 进行无限续订。','This is the message shown on the page as soon as the user submits the application form. The {couponcode} placeholder will be replaced with their chosen coupon code.'=>'这是用户提交申请表后页面上显示的消息。[优惠券代码] 占位符将被他们选择的优惠券代码所取代。','This is the name of the discount shown on the cart page, when store credit is applied.'=>'这是应用商店信用额度时购物车页面上显示的折扣的名称。','This is the new commission percentage that will be set for the affiliates coupon.'=>'这是将为会员优惠券设置的新佣金百分比。','This is the new fixed commission amount per order, that will be set for the coupon.'=>'这是每个订单的新固定佣金金额，将为优惠券设置。','This is the new fixed commission amount per product, that will be set for the coupon.'=>'这是将为优惠券设置的每件产品的新固定佣金金额。','This is the order status that will be assigned to the new order.'=>'这是将分配给新订单的订单状态。','This is the product ID of the product that will be added to the new order. You can find the product ID by going to the Products page and hovering over the product name.'=>'这是将添加到新订单的产品的产品 ID。您可以通过转到“产品”页面并将鼠标悬停在产品名称上来查找产品 ID。','This is the slug for the shortlinks, for example:'=>'例如，这是短链接的标段：','This is the user permission required to have full access for this plugin. Administrator will always have access to everything.'=>'这是拥有此插件的完全访问权限所需的用户权限。管理员将始终可以访问所有内容。','This is the user role that will be able to earn and view this reward.'=>'这是能够赚取和查看此奖励的用户角色。','This link will take you to the affiliate dashboard for this specific coupon. This allows admins to easily view stats for all your affiliates coupons.'=>'此链接将带您进入此特定优惠券的会员仪表板。这使管理员可以轻松查看所有会员优惠券的统计信息。','This may take a few seconds...'=>'这可能需要几秒钟...','This may therefore disregard some of the order statuses that are checked above.'=>'因此，这可能忽略上面检查的某些订单状态。','This means that you will need to manually edit existing users to the "coupon affiliate", or have them automatically assign to this role when filling out the registration form (enable this in "registration settings").'=>'这意味着您需要手动编辑现有用户到"优惠券联盟"，或让他们在填写注册表时自动分配到此角色（在"注册设置"中启用此）。','This Month'=>'这个月','This option will allow you to enable "lifetime commission" either globally, or on a per-coupon basis.'=>'此选项将允许您在全球范围内或以每票的基础上启用"终身佣金"。','This option will enable the "affiliate landing page" metabox on pages, for you to assign a page as a landing page for an affiliate coupon.'=>'此选项将启用页面上的"联盟着陆页"元框，以便您为联盟优惠券指定一个页面作为着陆页。','This page displays all the users that are assigned to an affiliate coupon.'=>'此页面显示分配给联盟优惠券的所有用户。','This plugin is frequently updated and maintained. If you notice any bugs, issues, or conflicts with other themes/plugins, please get in touch and it will be looked into.'=>'此插件经常更新和维护。如果您发现任何错误、问题或与其他主题/插件的冲突，请与您联系，并会对此进行调查。','This setting is required in case you have set custom commission amounts on both a coupon level, and product level.'=>'如果您在优惠券级别和产品级别上都设置了自定义佣金金额，则需要此设置。','This tab will show a table listing all your products, along with commission rates they will earn from each individual product.'=>'此选项卡将显示一个表格，其中列出了您的所有产品，以及他们将从每个产品中获得的佣金率。','This user does not exist, please enter a valid user, or enter an email address to create a new account.'=>'此用户不存在，请输入有效用户，或输入电子邮件地址以创建新帐户。','This username already exists. Please try again, or login first.'=>'此用户名已存在。请重试，或先登录。','This will affect the coupon usage stats, orders list, commission, and monthly summary.'=>'这将影响优惠券使用统计、订单列表、佣金和每月摘要。','This will allow affiliate users to login to the dashboard if they visit the base dashboard URL.'=>'这将允许联盟用户登录仪表板，如果他们访问基础仪表板 URL。','This will allow affiliates to click a toggle to only show converted clicks.'=>'这将允许联盟会员点击切换开关以仅显示转化后的点击次数。','This will allow affiliates to filter through their whole click history with pagination.'=>'这将允许联盟会员使用分页过滤其整个点击历史记录。','This will allow the affiliate user to replace the default link/URL in the "embed code" for each creative with their own URL.'=>'这将允许联盟用户用自己的 URL 替换每个创意的"嵌入代码"中的默认链接/URL。','This will allow the affiliate user to select a campaign, which will update the URL in the "embed code" for each campaign to include the campaign tracking parameter.'=>'这将允许联盟用户选择一个活动，该活动将更新每个活动"嵌入代码"中的 URL，以包括活动跟踪参数。','This will allow them to add extra emails to send their email notifications to.'=>'这将允许他们添加额外的电子邮件以发送电子邮件通知。','This will automatically apply the coupon every time at checkout for that visitor, until the cookie expires.'=>'这将在每次结账时自动应用优惠券，直到 Cookie 过期。','This will be shown before the coupon code shown in the header of the affiliate dashboard page, for example you could set it to "Coupon code:".'=>'这将显示在联盟仪表板页面标题中显示的优惠券代码之前，例如，您可以将其设置为“优惠券代码：”。','This will determine how the orders are sorted on the affiliate dashboard, either by the day they were paid for, or the day it was set to completed.'=>'这将确定如何在关联仪表板上对订单进行排序，无论是按付款日，还是在订单设置为完成的当天。','This will disable automatic ajax saving, and instead will enable the "Save Settings" button, and you will save all settings at once.'=>'这将禁用自动 ajax 保存，而是启用"保存设置"按钮，并且您将同时保存所有设置。','This will display a new "Rates" tab on the affiliate dashboard.'=>'这将在会员仪表板上显示一个新的“费率”选项卡。','This will enable "Creatives" in the admin menu, where you can upload your own banners (creatives) for affiliates to use.'=>'这将使管理员菜单中的"创意"能够上传自己的横幅（创意），供关联公司使用。','This will enable "Performance Bonuses" in the admin menu, where you can add multiple different bonuses, with certain requirementse and rewards.'=>'这将在管理菜单中启用“绩效奖金”，您可以在其中添加多个不同的奖金，并具有某些要求和奖励。','This will enable payouts features, and keep track of "unpaid commission" for each coupon, whenever new orders are created using that coupon.'=>'这将启用支付功能，并跟踪每个优惠券的"未付佣金"，每当使用该优惠券创建新订单。','This will enable the coupon affiliate registration features on your website.'=>'这将使优惠券联盟注册功能在您的网站上。','This will enable the coupon affiliate registration system on your website.'=>'这将在您的网站上启用优惠券联盟注册系统。','This will further increase initial loading speed/performance. It will only start loading content for each tab when the tab is clicked, showing the "loading..." animation whilst it loads.'=>'这将进一步提高初始加载速度/性能。它只会在单击选项卡时开始加载每个选项卡的内容，显示"加载..."动画， 而它加载。','This will hide the bonus from the affiliate dashboard, but it will still be active and will grant rewards when achieved.'=>'这将从会员仪表板中隐藏奖金，但它仍将处于活动状态，并在实现时授予奖励。','This will instantly create a new "gift" coupon for that affiliate to use as a discount on future orders they place themselves. This is NOT an affiliate coupon.'=>'这将立即为该会员创建一个新的“礼物”优惠券，以用作他们自己下达的未来订单的折扣。这不是会员优惠券。','This will instantly create a new order for that affiliate user, with the product at a 100% discount.'=>'这将立即为该会员用户创建一个新订单，产品可享受 100% 的折扣。','This will make it so when each tab is clicked, it reloads the page, but it only loads the content for the selected tab.'=>'这样，当每个选项卡被单击时，它会重新加载页面，但它只加载所选选项卡的内容。','This will make the initial page loading much faster for larger coupons, and show a "loading" animation in these sections whilst it loads content (usually takes no longer than a few seconds).'=>'这将使初始页面加载速度大大加快，用于较大的优惠券，并在加载内容时在这些部分显示"加载"动画（通常不超过几秒钟）。','This will not apply the coupon discount to the order, it simply links the coupon/affiliate to that order for them to earn commission for it.'=>'这不会将优惠券折扣应用于订单，它只是将优惠券/会员链接到该订单，以便他们赚取佣金。','This will not delete your orders or WooCommerce data. If you want to be safe, be sure to make a backup of your website beforehand in-case you want to restore this data.'=>'这不会删除您的订单或伍商业数据。如果您想要安全，请务必事先备份您的网站，以防您想要恢复此数据。','This will remove/deduct the tax amount from the store credit, if it is added to the credit amount in the cart.'=>'如果将税款金额添加到购物车中的积分金额中，这将从商店积分中删除/扣除税费金额。','This will replace your default WooCommerce email template "header image" with a custom one for your reports.'=>'这将用您的报告的自定义图像替换您的默认WooCommerce电子邮件模板"标题图像"。','This will show a "Landing Pages" section on the affiliate dashboard in the "Referral URL" tab, with all the assigned landing pages for the affiliate coupon.'=>'这将在"参考 URL"选项卡的联盟仪表板上显示"着陆页"部分，以及联盟优惠券的所有指定着陆页面。','This will show a "Payouts" tab on the coupon usage/info page, so the affiliate can view their unpaid commission, and request payouts.'=>'这将在优惠券使用/信息页面上显示"付款"选项卡，以便关联公司可以查看其未付佣金并请求付款。','This will show a table with a log of the latest referral URL clicks/visits for the affiliate coupons referral URL (or selected campaign).'=>'这将显示一张表，其中记录了联盟优惠券转介 URL（或选定的活动）的最新推荐 URL 点击/访问记录。','This will show the affiliate application/registration form automatically on the affiliate page for logged out users (alongside the login form).'=>'这将在联属页面上自动显示已注销用户的联盟申请/注册表（与登录表一起）。','This will show the current "Store Credit" for each user on the "All Users" admin page.'=>'这将在"所有用户"管理页面上显示每个用户的当前"商店信用额度"。','This will show the WooCommerce "Account Details" fields directly in the "settings" tab on the affiliate dashboard, along with a logout link.'=>'这将直接在附属仪表板上的"设置"选项卡中显示 Woo 商业"帐户详细信息"字段，以及注销链接。','This will still show the "Last 30 Days" and "Last 7 Days". It will also cause the "usage" stat to be calculated slightly different.'=>'这仍将显示"最后 30 天"和"最后 7 天"。它还会导致"使用"统计的计算略有不同。','This will then automatically convert all the stats, order totals and commission on the affiliate dashboard into your base store currency, even if the order is made in a different currency.'=>'然后，这将自动将附属仪表板上的所有统计数据、订单总数和佣金转换为基础存储货币，即使订单以不同的货币进行。','This will work in the same way as if the user clicked the "Request Payout" button in their dashboard.'=>'这将以与用户单击仪表板中的"请求支付"按钮相同的方式工作。','Threshold for automatic payouts'=>'自动付款的阈值','Tier'=>'层','to'=>'自','To assign users to a specific coupon, go to the'=>'要将用户分配给特定优惠券，请访问','To assign users to a specific coupon, go to the <a href="%1$s" target="_blank">coupons page</a>, edit a coupon and assign users under the "coupon affiliates" tab. <a href="%2$s" target="_blank">Learn More.</a>'=>'要将用户分配到特定优惠券，请转到优惠券页面，编辑 <a href="%1$s" target="_blank">优惠券</a>并在“优惠券关联公司”选项卡下分配用户。 了解更多 <a href="%2$s" target="_blank">。</a>','To completely refresh each of your affiliate dashboards stats for past orders, with the new conversion rates, <a href="%s">click here</a>. (The first page load for each dashboard may take slightly longer.)'=>'要使用新的转化率完全刷新过去订单的每个会员仪表板统计信息， <a href="%s">请单击此处</a>。（每个仪表板的第一页加载可能需要稍长的时间。','To customise the "Creatives" tab, please go to the creatives settings:'=>'要自定义“广告素材”标签，请转到广告素材设置：','To customise the "Performance Bonuses", please go to the "Bonuses" settings:'=>'要自定义“绩效奖金”，请转到“奖金”设置：','To customise the "Referral URLs" tab, please go to the referral URL settings:'=>'要自定义“引荐网址”标签，请转到引荐网址设置：','To display the affiliate application form on a custom page, use the shortcode: '=>'要在自定义页面上显示联盟应用程序表，请使用短代码：','To display the affiliate dashboard for the coupon(s) assigned to the logged in user use shortcode:'=>'要显示分配给登录用户的优惠券的附属仪表板，请使用短代码：','To do this go to "Pro Settings" and toggle on "Enable lifetime commission features." option.'=>'要做到这一点，请转到"专业设置"，并切换到"启用终身佣金功能"选项。','to fully translate this plugin.'=>'完全翻译此插件。','To get started with affiliate email reports, first enable it in the "PRO Modules" section of the settings, then setup and customise the settings in the new "Reports" settings tab that will appear.'=>'要从联盟电子邮件报告开始，请首先在设置的"PRO 模块"部分启用它，然后设置和自定义将要出现的新"报告"设置选项卡中的设置。','To get started with affiliate registration, you will need to add this shortcode to a NEW page:'=>'要开始联盟注册，您需要将此短代码添加到页面：','To get started with creatives, first go to the "Creatives" settings to to enable and customise the settings.'=>'要从创意开始，请首先转到"创意"设置，以启用和自定义设置。','To get started with Multi-Currency support, simply enable "multi-currency settings" under the "General" settings tab. A new tab will the appear labeled "currencies" to customise your currencies and conversion rates.'=>'要从多货币支持开始，只需在"一般"设置选项卡下启用"多货币设置"。一个新的标签将出现标记为"货币"，以自定义您的货币和转换率。','To get started with multi-level affiliates, you will need to create the MLA dashboard page. Simply add this shortcode to a new page:'=>'要开始使用多级联盟会员，您需要创建 MLA 仪表板页面。只需将此短代码添加到新页面：','To get started with this integration, you first need to install and activate the "%s" plugin.'=>'要开始此集成，首先需要安装并激活"%s"插件。','To get started, simply enable the "Affiliate Landing Pages" option in "Pro Settings" then you will see a new meta box when editing pages, to assign an affiliate coupon to that page.'=>'要开始，只需在"专业设置"中启用"联盟着陆页"选项，然后您将在编辑页面时看到一个新的元框，以便向该页面分配联盟优惠券。','To manage (and enabl