,'View Bonus'=>'查看奖金','VIEW BONUSES'=>'查看奖金','View Bonuses'=>'查看奖金','View Changelog'=>'查看更新日志','View Coupons List & Unique Links'=>'查看优惠券列表和唯一链接','VIEW CREATIVES'=>'查看广告素材','View Creatives'=>'查看广告素材','View Dashboard'=>'查看仪表板','View in PayPal'=>'在PayPal查看','View in Stripe'=>'在条纹中查看','View Landing Page'=>'查看着陆页面','View More'=>'查看更多','View Product'=>'查看产品','View Reports'=>'查看报告','View setup guide'=>'查看设置指南','View transaction in PayPal.'=>'以PayPal查看交易。','View transaction in Stripe.'=>'查看条纹交易。','Viewing MLA dashboard for user:'=>'查看用户的 MLA 仪表板：','Visibility Settings'=>'可见性设置','Visit Date'=>'访问日期','Visit the <a href="%s" target="_blank">settings page</a> to edit more options, and customise your affiliate program to work exactly how you want!'=>'访问 <a href="%s">设置页面</a> 以编辑更多选项，并自定义您的联盟计划以完全按照您想要的方式工作！','Visitor ID'=>'访客编号','Visitors Blacklist'=>'访客黑名单','Visitors referred directly from any of these domains will not have referrals tracked or coupons applied automatically.'=>'直接从任何这些域推荐的访问者将不会跟踪推荐或自动应用优惠券。','Wallet System'=>'钱包系统','Want more advanced features?'=>'想要更多高级功能？','Want us to create a new plugin integration?'=>'希望我们创建一个新的插件集成？','Warning: If you use this option, you should be even more careful of fraudulent activity. We do recommend reviewing and accepting payouts manually instead, simply so you can make sure each payout is valid and non-fraudulent.'=>'警告：如果使用此选项，则应更加小心欺诈活动。我们建议您改为手动查看和接受付款，这样您就可以确保每次付款都是有效且非欺诈性的。','Warning: You will want to create a "template coupon" and assign it in the settings for affiliate coupons to be generated properly.'=>'警告：您将需要创建一个“模板优惠券”，并在设置中分配它，以便正确生成联盟优惠券。','was updated'=>'已更新','We are going to run you through some of the most important settings in the Coupon Affiliates plugin, to help you get everything setup!'=>'我们将引导您完成优惠券联盟插件中一些最重要的设置，以帮助您完成一切设置！','We are reviewing your application and will be in touch soon!'=>'我们正在审核您的申请，并会尽快与您联系！','We highly recommend that you keep this option DISABLED, as it may cause some issues or paying too much commission.'=>'我们强烈建议您将此选项保留为禁用状态，因为它可能会导致一些问题或支付过多的佣金。','Website'=>'网站','Weekly'=>'周刊','Welcome to the Coupon Affiliates setup wizard!'=>'欢迎来到优惠券联盟设置向导！','What happens when an order is refunded or partially refunded?'=>'订单退款或部分退款时会发生什么？','What is a "coupon-based" affiliate program?'=>'什么是“基于优惠券”的联盟计划？','What should happen after form submission?'=>'提交表格后会发生什么？','What time of the day should payouts be requested automatically?'=>'应自动要求在一天中的什么时间付款？','What time of the day should reports be sent?'=>'应在一天中的什么时间发送报告？','What toggles should be shown for statistics and line graphs?'=>'应为统计数据和折线图显示哪些切换？','What type of coupon would you like?'=>'您想要什么类型的优惠券？','WhatsApp Text'=>'WhatsApp Text','When a payout request is submitted, you will be able to view, manage, and pay it from the admin "<a href="%s">Payouts</a>" page.'=>'提交收款请求后，您将能够从管理员的“<a href="%s">收款</a>”页面查看、管理和付款。','When an affiliate adds a new domain to their account, an email will be sent to your admin email, with a link to approve or deny the domain.'=>'当联盟会员将新域添加到其帐户时，系统会向您的管理员电子邮件发送一封电子邮件，其中包含用于批准或拒绝该域的链接。','When an order is completed using a users coupon, the commission will be added to the affiliate account assigned to that coupon as "unpaid commission".'=>'当使用用户优惠券完成订单时，佣金将添加到分配给该优惠券的附属帐户中，作为"未付佣金"。','When assigning users to coupons, if this is enabled, it will only show the list of users with the custom "coupon affiliate" role.'=>'将用户分配到优惠券时，如果启用此优惠券，则仅显示具有自定义"优惠券联盟"角色的用户列表。','When checked, this coupon can only be used by new customers on their first order.'=>'选中后，此优惠券只能由新客户在第一个订单上使用。','When completing this form, it will automatically submit an approved affiliate registration for that user, automatically creating the coupon and assigning them to it.'=>'填写此表单后，它将自动为该用户提交会员注册，自动创建优惠券并将其分配给它。','When disabled, if there are no users assigned to a coupon, the dashboard can be viewed by anyone if they visit the unique URL directly. However, if there is a user assigned to it, the URL will be private.'=>'禁用后，如果没有用户分配到优惠券，则任何人都可以直接访问唯一 URL，从而查看仪表板。但是，如果为其分配了用户，则该 URL 将是私有的。','When disabled, if you change commission rates, it will automatically update the stats/commission for ALL new and past orders on the affiliate dashboard.'=>'禁用后，如果您更改佣金率，它将自动更新联盟仪表板上所有新订单和过去订单的统计数据/佣金。','When disabled, it will only allow 1 affiliate coupon to be used per order. (This is any coupons that have an affiliate user assigned to them.)'=>'禁用后，每次订单只能使用 1 个附属优惠券。（这是任何将附属用户分配给他们的优惠券。','When disabled, the affiliate user will be prevented from using their own coupon code (coupons they are assigned to) at cart or checkout.'=>'禁用后，联营用户将被禁止在购物车或结账时使用自己的优惠券代码（他们被分配到的优惠券）。','When enabled, % commission will be calculated based on the order subtotal/total including "fees". It will also be added to the subtotal/total shown in statistics.'=>'启用后，佣金百分比将根据订单小计/总计（包括"费用"）计算。它还将添加到统计信息中显示的小计/总计中。','When enabled, % commission will be calculated based on the order subtotal/total including "shipping costs".'=>'启用后，佣金百分比将根据订单小计/总计（包括“运费”）计算。','When enabled, % commission will be calculated before any custom discounts are deducted from the subtotal/total. It will also be added to the subtotal/total shown in statistics.'=>'启用后，将在从小计/总计中扣除任何自定义折扣之前计算佣金百分比。它还将添加到统计信息中显示的小计/总计中。','When enabled, % commission will be calculated on the order subtotal (instead of total), before the coupon discount is deducted from it.'=>'启用后，佣金百分比将在订单小计（而不是总计）上计算，然后从中扣除优惠券折扣。','When enabled, a "MLA Dashboard" link will be shown on the normal coupon affiliate dashboard, at the top right, next to the "Logout" link.'=>'启用后，“MLA仪表板”链接将显示在普通优惠券联盟仪表板上，位于右上角的“注销”链接旁边。','When enabled, a "statement" PDF file will be generated automatically whenever payout requests are made by the affiliate. These statements show the payout details, status, company information, etc.'=>'启用后，每当关联公司提出付款请求时，将自动生成"声明"PDF 文件。这些报表显示付款详情、状态、公司信息等。','When enabled, a new "Payout Statement Details" section is displayed in the "Settings" tab of the affiliate dashboard, to enter their billing data to show on statements.'=>'启用后，新的"付款声明详细信息"部分将显示在关联仪表板的"设置"选项卡中，以输入其计费数据以显示在报表上。','When enabled, a new checkbox will appear on store checkout, under order notes, for them to join the affiliate program. This will submit an affiliate registration application for the user.'=>'启用后，商店结账时将在订单备注下显示一个新复选框，供他们加入联盟计划。这将为用户提交联盟注册申请。','When enabled, affiliates can download a statement for both pending and completed payouts. If disabled, they can only download statements for completed payouts.'=>'启用后，关联公司可以下载待决和已完成付款的报表。如果禁用，他们只能下载已完成付款的报表。','When enabled, all unique affiliate dashboard URLs will ALWAYS be private, and only be visible to the assigned user (and admins).'=>'启用后，所有唯一的联盟仪表板 URL 将始终是私有的，并且仅对分配的用户（和管理员）可见。','When enabled, commission statistics are disabled/hidden for coupons that are not assigned to an affiliate user.'=>'启用后，将禁用/隐藏未分配给联盟用户的优惠券的佣金统计信息。','When enabled, commission will be calculated and displayed on the affiliate dashboard.'=>'启用后，佣金将被计算并显示在会员仪表板上。','When enabled, if a customer uses an MLA users affiliate coupon code in an order, that customer will also automatically be assigned as a sub-affiliate in their MLA network (if not already assigned to one).'=>'启用后，如果客户在订单中使用 MLA 用户关联优惠券代码，则该客户也将自动分配为其 MLA 网络中的子代理（如果尚未分配给子代理）。','When enabled, if an MLA invite link is visited, the link will also work like a normal affiliate referral link, to apply the coupon to cart and track affiliate referrals if they place an order.'=>'启用后，如果访问了MLA邀请链接，则该链接也将像普通的会员推荐链接一样工作，以将优惠券应用于购物车并在会员推荐下订单时跟踪他们。','When enabled, the affiliate will be required to enter their payment details before they can request a payout.'=>'启用后，联盟会员将被要求输入其付款详细信息，然后才能请求付款。','When enabled, the checkbox to join the affiliate program will be checked automatically.'=>'启用后，将自动选中加入联盟计划的复选框。','When enabled, the PAST orders will not be affected (even if clicking "refresh data"), and it will only set the updated rates for NEW orders. The only time it WILL be updated is if an order is refunded.'=>'启用后，PAST订单将不受影响（即使单击“刷新数据”），并且只会为新订单设置更新的费率。它唯一会更新的时间是订单退款。','When enabled, this will also show the adjusted "total" and "subtotal" (with deducted percentage) on affiliate dashboard. When disabled, only the "commission" stat will be affected by the adjustment.'=>'启用后，这还将在联属仪表板上显示调整后的"总"和"子整体"（扣除百分比）。当禁用时，只有"佣金"统计将受调整的影响。','When enabled, visitors referred by blocked domains will be completely blocked from entering any affiliate coupons manually (as long as the cookie is saved).'=>'启用后，被阻止域引用的访问者将被完全阻止手动输入任何联盟优惠券（只要保存cookie）。','When selected, a "Status" dropdown will be shown as an option when filtering by date range. Will only show if you have more than 1 status enabled.'=>'选中后，按日期范围过滤时，“状态”下拉菜单将显示为一个选项。仅当您启用了 1 个以上的状态时才会显示。','When selected, below the orders table it will show the total number of orders for each status. The "Status" column needs to be enabled.'=>'选择后，在订单表下方，它将显示每种状态的订单总数。需要启用“状态”列。','When selected, the totals for all orders within the selected date range will be shown in a new row at the bottom of the recent orders and monthly summary table.'=>'选中后，所选日期范围内所有订单的总计将显示在最近订单和每月汇总表底部的新行中。','When someone uses the referral URL, if the code is automatically applied, it will show this message on all pages.'=>'当某人使用转介 URL 时，如果自动应用代码，它将在所有页面上显示此消息。','When they submit the affiliate registration form you can then view and edit the coupon code they have entered, before approving the affiliate registration.'=>'当他们提交联盟注册表格时，您可以在批准联盟注册之前查看和编辑他们输入的优惠券代码。','When updating these settings, you may need to click the "REFRESH ALL DATA" button in the "Debug" tab for changes to show immediately for existing orders.'=>'更新这些设置时，您可能需要单击"调试"选项卡中的"刷新所有数据"按钮，以便立即为现有订单显示更改。','When you accept an affiliate, a new coupon is created with the same settings, and is automatically assigned to user.'=>'当您接受联盟会员时，将使用相同的设置创建新的优惠券，并自动分配给用户。','When you create an affiliate user, or accept an affiliate registration, their coupon code is automatically created and assigned to them. They will automatically be sent an email which includes a link to their dashboard. You can customize this email in the plugin settings.'=>'当您创建联盟用户或接受联盟注册时，他们的优惠券代码会自动创建并分配给他们。他们将自动收到一封电子邮件，其中包含指向其仪表板的链接。您可以在插件设置中自定义此电子邮件。','Where can I get plugin support?'=>'我在哪里可以获得插件支持？','where product ID is'=>'其中产品 ID 为','Which custom commission values should be applied as priority?'=>'应优先应用哪些自定义佣金值？','Who can apply affiliate coupons to their cart?'=>'谁可以将联盟优惠券应用到他们的购物车？','With admin reports, you can view statistics and analytics for all your coupons and affiliates.'=>'通过管理员报告，您可以查看所有优惠券和附属公司的统计数据和分析。','With lifetime commission enabled, once someone uses the affiliates coupon code, that customer will be linked to the affiliate forever, and ALL future purchases from that customer and will count as a referral, even if they dont re-use the coupon code.'=>'启用终身佣金后，一旦有人使用联营优惠券代码，该客户将永久链接到关联公司，并且将来从该客户处购买的所有产品都将计入转介，即使他们不再重复使用优惠券代码。','With the "[couponaffiliates]" shortcode, when a user visits this page (without the unique URL ID), enable to show full affiliate dashboard automatically if the affiliate user is only assigned to one coupon.'=>'使用"[优惠券附属]"短代码，当用户访问此页面（没有唯一的 URL ID）时，如果关联用户只被分配到一个优惠券，则能够自动显示完整的联盟仪表板。','With the free version, you will need to manually handle payouts and payment details. There are a few ways that you can do this, such as generating a detailed admin report. <a href="%s">Click here to learn more.</a>'=>'使用免费版本，您将需要手动处理付款和付款详细信息。有几种方法可以做到这一点，例如生成详细的管理报告。 <a href="%s">点击这里了解更多。</a>','With the PRO version can also set commission rates per each individual affiliate/coupon, or product.'=>'使用PRO版本还可以为每个单独的联盟/优惠券或产品设置佣金率。在下面了解更多信息。','With the Pro version get access to unlimited date range on the admin reports, export to CSV, and access to date comparison features, to compare analytics between 2 sets of dates'=>'随着 Pro 版本在管理员报告中访问无限日期范围，导出到 CSV，并访问日期比较功能，以比较 2 套日期之间的分析','with the settings you want the gift coupons to include, and enter the name here. The new gift coupons generated will copy all the settings from this template.'=>'使用您希望包含礼券的设置，然后在此处输入名称。生成的新礼品券将复制此模板中的所有设置。','With this disabled, only logged in users can apply.'=>'使用此禁用时，只能登录用户进行申请。','With this enabled commission will be paid instantly into the affiliate account automatically, as soon as they request a payout. This will apply to Stripe, PayPal and Store Credit payout methods.'=>'启用此佣金后，一旦他们请求付款，佣金将立即自动支付到联盟帐户中。这将适用于 Stripe、PayPal 和 Store Credit 付款方式。','With this enabled, "administrator" users will be able to fill out the affiliate registration form for new users (custom username/email etc), whilst logged in.'=>'启用此功能后，"管理员"用户将能够在登录时填写新用户的联盟注册表（自定义用户名/电子邮件等）。','With this enabled, a new "Affiliate" link will appear on the users "My Account" page menu. This will take them to the affiliate dashboard page selected above.'=>'启用此功能后，用户"我的帐户"页面菜单上将显示新的"联盟"链接。这将带他们到上面选择的联盟仪表板页面。','With this enabled, a new "Upload Invoice" option will be displayed above the "Request Payout" button on the "Payouts" tab. They can click this to upload their PDF invoice for the payout, then submit their payout request.'=>'启用此功能后，新的"上传发票"选项将显示在"付款"选项卡上的"请求付款"按钮上方。他们可以单击此操作以上传付款的 PDF 发票，然后提交付款请求。','With this enabled, a second password field will be shown to require users to confirm their password.'=>'启用此功能后，将显示第二个密码字段，要求用户确认其密码。','With this enabled, admin accounts will also be able to view the "payouts" tab when viewing any of the affiliate coupon dashboard pages.'=>'启用此功能后，管理员帐户在查看任何联盟优惠券页面时还可以查看"付款"选项卡。','With this enabled, affiliate registrations will be automatically accepted (and coupon auto-created instantly), instead of manual approval.'=>'启用此功能后，将自动接受关联注册（并立即自动创建优惠券），而不是手动批准。','With this enabled, affiliate users can click a button to automatically generate a short URL for their referral link.'=>'启用此功能后，联盟用户可以单击按钮，自动生成其转介链接的短网址。','With this enabled, affiliate users can click a button to generate a QR code for their referral link.'=>'启用此功能后，联盟用户可以单击按钮以生成其转介链接的 QR 代码。','With this enabled, affiliate users can link their website domain to their coupon.'=>'启用此功能后，联盟用户可以将其网站域链接到其优惠券。','With this enabled, all renewals for subscriptions will also be rewarded commission (if the affiliate referred the customer) and renewal orders displayed on the dashboard.'=>'启用此功能后，订阅的所有续订也将获得奖励佣金（如果关联公司转介客户）和仪表板上显示的续订订单。','With this enabled, if someone follows a referral link and registers (creates an account), they will then be linked to that affiliate, even without initially placing an order.'=>'启用此功能后，如果有人点击推荐链接并注册（创建帐户），即使最初没有下订单，他们也会被链接到该联盟会员。','With this enabled, in the "referral URL" section your affiliates will be able to create "campaigns", to generate custom URLs, track clicks, sales, conversation rate for specific referral campaigns.'=>'启用此功能后，在"推荐 URL"部分，您的关联公司将能够创建"活动"，生成自定义网址、跟踪点击率、销售、特定推荐活动的对话率。','With this enabled, instead of the user entering their "preferred coupon code", a code will be generated for them automatically.'=>'启用此功能后，用户将自动为他们生成格式化代码，而不是用户输入其"首选优惠券代码"。','With this enabled, instead of using the default WordPress "subscriber" user role, new affiliate users will be assigned to the custom "coupon affiliate" user role (or the custom role defined below) instead.'=>'启用此功能后，新联盟用户将改用自定义的"优惠券联盟"用户角色（或下面定义的自定义角色），而不是使用默认 WordPress"订阅者"用户角色。','With this enabled, it will permanently save and use the commission rate that was set at the time the order is created, even if you update the rates below.'=>'启用此功能后，即使您更新了下面的费率，它也会永久保存并使用订单创建时设置的佣金率。','With this enabled, logged out users can view the registration form (with some extra fields). When submitted it will create a new account for them, and submit the affiliate application.'=>'启用此功能后，注销的用户可以查看注册表（带有一些额外的字段）。提交后，它将为他们创建一个新帐户，并提交联盟申请。','With this enabled, multiple template coupons will be available and the affiliate will be able to choose which type they want via the registration form.'=>'启用此功能后，将提供多个模板优惠券，并且联盟会员将能够通过注册表选择他们想要的类型。','With this enabled, some of the fields on the form will be displayed in 2 columns, such as first and last name.'=>'启用此功能后，表单上的某些字段将显示在 2 列中，例如名字和姓氏。','With this enabled, the affiliate can only request a payout if they have attached an invoice (PDF file).'=>'启用此功能后，关联公司只能在已附加发票 （PDF 文件） 的情况下请求付款。','With this enabled, the first ever payout request by an affiliate will require manual approval. After they have at-least 1 completed payout, all future payouts can be paid automatically.'=>'启用此功能后，联盟会员的首次付款请求将需要手动批准。在他们至少完成 1 次付款后，所有未来的付款都可以自动支付。','With this enabled, the first name and last name fields will be required.'=>'启用此功能后，将需要名字和姓氏字段。','With this enabled, the link will be hidden for users that are not assigned to a coupon.'=>'启用此功能后，对于未分配给优惠券的用户，该链接将被隐藏。','With this enabled, the new user account created will be assigned to the default "Subscriber" role (or the custom role defined below) initially, and only when their affiliate application is accepted will they be assigned to the "coupon affiliate" user role instead.'=>'启用此功能后，创建的新用户帐户将最初分配到默认的"订阅者"角色（或下面定义的自定义角色），只有当其联盟应用程序被接受时，他们才会被分配到"优惠券联盟"用户角色。','With this enabled, the pending user role will be removed from the affiliate when the application is accepted.'=>'启用此功能后，当应用程序被接受时，待决用户角色将从联盟中删除。','With this enabled, the username field will be hidden, and the email address will be used as their username instead.'=>'启用此功能后，将隐藏用户名字段，并将电子邮件地址用作用户名。','With this enabled, when adding a new domain, affiliates will be able to select a "campaign" to assign that domains referrals to.'=>'启用此功能后，在添加新域时，联盟会员将能够选择要将该域的引荐分配给该域的"广告系列"。','With this enabled, when the "Affiliate" tab is clicked, instead of redirecting to the normal affiliate dashboard page, it will show the affiliate dashboard as a page/section within "My Account".'=>'启用此功能后，当单击“会员”选项卡时，它不会重定向到普通的会员仪表板页面，而是将会员仪表板显示为“我的帐户”中的页面/部分。','With this feature, you can enable an option to prevent ALL affiliate coupons and referral links from working UNLESS the customer was directly linked by the approved domain that is assigned to that coupon.'=>'使用此功能，您可以启用一个选项来阻止所有优惠券和推荐链接正常工作，除非客户由分配给该优惠券的批准域直接链接。','WooCommerce coupons list'=>'伍商业优惠券列表','WooCommerce Subscriptions Settings'=>'伍商业订阅设置','WooCommerce – Integration Guide'=>'伍商务 – 集成指南','Year (optional):'=>'年份（可选）：','Yes'=>'是的','Yes, you can view the dashboard for each of your affiliates\' coupons by going to the <a href="%s" target="_blank">coupons page</a> and click the "Dashboard" link.'=>'是的，您可以通过转到优惠券页面并单击“仪表板”链接来查看每个会员 <a href="%s" target="_blank">优惠券</a> 的仪表板。','You already have a pending affiliate application.'=>'你已有一个待处理的关联应用程序。','You are all set! Store credit payouts will now be added to the users "%s" wallet automatically in one-click.'=>'一切准备就绪！现在，一键式将自动将商店信用支出添加到用户的"%s"钱包中。','You are all set! Store credit payouts will now be added to the users wallet automatically in one-click. They can spend this credit when visiting the cart/checkout.'=>'一切准备就绪！商店信用支出现在只需单击一下即可自动添加到用户钱包中。他们可以在访问购物车/结账时花费此积分。','You are already registered as an affiliate.'=>'您已经注册为联盟会员。','You are sending too many of requests in a short time and have been temporarily timed out.'=>'您在短时间内发送了太多的请求，并且已暂时中断。','You can <a href="%s" target="_blank">edit your template coupon</a> if you want to change the default affiliate coupon settings.'=>'如果您想更改默认的会员优惠券设置，您可以 <a href="%s" target="_blank">编辑模板优惠券</a> 。','You can adjust the horizontal and vertical margins to move the text around. The alignment of the text is centered.'=>'您可以调整水平和垂直边距以移动文本。文本的对齐方式居中。','You can also show their default link anywhere using the shortcode: [couponaffiliates-referral-url]'=>'您还可以使用短代码在任何地方显示他们的默认链接：[couponaffiliates-referral-url]','You can also view a full list of the coupons, with the assigned user, pending payments, and unique affiliate dashboard links for each coupon (to view yourself) on the WooCommerce'=>'您还可以查看优惠券的完整列表，包括分配的用户，待处理的付款以及每个优惠券的唯一联盟仪表板链接（以查看自己）','You can apply additional strict fraud prevention with direct link tracking.'=>'您可以通过直接链接跟踪来应用其他严格的欺诈预防。','You can create groups here:'=>'您可以在此处创建组：','You can customize the plugin to mee